/// Look up the mixed output for three channel levels using the empiric DAC table.
///
/// # Arguments
/// * `lva` - Channel A level (0-31)
/// * `lvb` - Channel B level (0-31)
/// * `lvc` - Channel C level (0-31)
///
/// # Returns
/// Signed 16-bit audio sample (-32768 to +32767 range, centered around 0)
#[inline]
pub fn empiric_dac_lookup(lva: usize, lvb: usize, lvc: usize) -> i32 {
    let idx = (lvc << 10) | (lvb << 5) | lva;
    EMPIRIC_DAC[idx] as i32 - 0x8000
}
